INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Sentadillas', 'Comienza de pie con los pies separados al ancho de los hombros. Mant√©n la espalda recta y el pecho elevado. Al bajar, empuja las caderas hacia atr√°s como si te fueras a sentar en una silla. Mant√©n las rodillas en l√≠nea con los pies y no dejes que se desplacen hacia adelante m√°s all√° de los dedos de los pies. Baja hasta que tus muslos est√©n paralelos al suelo o hasta donde te sientas c√≥modo. Regresa a la posici√≥n inicial empujando a trav√©s de los talones.', 'Inhala al bajar. Exhala al subir.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Press de banca', 'Acu√©state en una banca con los pies firmemente en el suelo. Agarra la barra con un agarre un poco m√°s ancho que el ancho de los hombros. Levanta la barra del soporte y mant√©n los brazos extendidos. Baja la barra hacia el pecho de manera controlada. Empuja la barra hacia arriba hasta que los brazos est√©n completamente extendidos.', 'Inhala al bajar la barra. Exhala al empujar la barra hacia arriba.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Puentes de gl√∫teos', 'Si√©ntate en el suelo con una banca detr√°s de ti y una barra cargada sobre tus caderas. Apoya la parte superior de la espalda en la banca y aseg√∫rate de que tus hombros est√©n en el borde de la misma. Empuja a trav√©s de tus talones y levanta tus caderas hacia el techo, apretando los gl√∫teos en la parte superior. Baja las caderas hacia el suelo de manera controlada.', 'Inhala al bajar las caderas. Exhala al levantar las caderas.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Crunches abdominales', 'Acu√©state en el suelo con las rodillas dobladas y los pies planos en el suelo. Coloca tus manos detr√°s de tu cabeza o cruzadas sobre el pecho. Levanta la parte superior del cuerpo del suelo, contrayendo los m√∫sculos abdominales. Baja de nuevo de manera controlada.', 'Exhala al levantar la parte superior del cuerpo. Inhala al bajar.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Sentadillas - no equipo', 'Pies a la anchura de los hombros, baja el cuerpo manteniendo la espalda recta. Opciones de equipo: Puedes sostener una maleta, una mochila con libros o mancuernas.', 'Inhala al bajar, exhala al subir.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Lunges o zancadas - no equipo', 'Da un paso adelante, baja el cuerpo manteniendo la postura. Opciones de equipo: Mancuernas en las manos o una mochila con peso.', 'Inhala al bajar, exhala al subir.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Wall Sit - no equipo', 'Espalda contra la pared, piernas a 90 grados. Opciones de equipo: Puedes sostener un peso contra el pecho.', 'Respira de manera constante y controlada.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Push-ups o flexiones - no equipo', 'Manos m√°s anchas que los hombros, cuerpo recto. Opciones de equipo: Puedes usar bandas de resistencia.', 'Inhala al bajar, exhala al subir.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Flexiones inclinadas - no equipo', 'Manos en una superficie elevada, cuerpo recto. Opciones de equipo: Sin equipo o con bandas de resistencia.', 'Inhala al bajar, exhala al subir.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Flexiones declinadas - no equipo', ' Pies en una superficie elevada, manos en el suelo. Opciones de equipo: Sin equipo o con bandas de resistencia.', 'Inhala al bajar, exhala al subir.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Glute Bridge - no equipo', 'Acostado, rodillas dobladas, levanta los gl√∫teos. Opciones de equipo: Puedes colocar una pesa sobre la pelvis.', 'Exhala al subir, inhala al bajar.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Donkey Kicks - no equipo', 'A cuatro patas, levanta una pierna manteniendo la rodilla doblada. Opciones de equipo: Puedes usar tobilleras con peso.', 'Exhala al levantar la pierna, inhala al bajar.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Clamshells - no equipo', 'Acostado de lado, rodillas dobladas, abre y cierra las piernas. Opciones de equipo: Puedes usar bandas de resistencia.', 'Exhala al abrir las piernas, inhala al cerrar.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Plank o plancha - no equipo', 'Cuerpo recto, apoyado en antebrazos y puntas de los pies. Opciones de equipo: Sin equipo.', 'Respira de manera constante y controlada.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Crunches - no equipo', 'Acostado, rodillas dobladas, lleva el pecho hacia las rodillas. Opciones de equipo: Sin equipo.', 'Exhala al subir, inhala al bajar.');
INSERT INTO Ejercicio(nombre, instruccionEjecucion, instruccionRespiracion) VALUES ('Leg Raises - no equipo', ' Acostado, levanta las piernas manteni√©ndolas rectas. Opciones de equipo: Sin equipo.', 'Exhala al levantar las piernas, inhala al bajar.');
